    const wheelHandler = (e) =>{
      e.preventDefault();
    };
    const sliderDivRefCurrnet = sliderDivRef.current;
    sliderDivRefCurrnet.addEventListener("wheel", wheelHandler);
  })
  return (
    <div className="slider">
      <SignInObject/>
